import java.io.*;
import java.util.Scanner;

public class resetAll{

	public static void main(String[] args){
		try{
			String content = new Scanner(new File("/vol/web/html/didYouTwo.txt")).useDelimiter("\\Z").next();
			String[] parts = content.split("00101100|\\00111011");
			for(int i = 1; i < parts.length; i+=2){
				parts[i] = "001011000110011000111011";
			}
			String all = "";
			for(int x = 0; x < parts.length; x++){
				all += parts[x];
			}
			all = "";
			BufferedWriter bw = new BufferedWriter(new FileWriter("/vol/web/html/didYouTwo.txt"));
			bw.write(all);
			bw.close();
		}catch(IOException e){e.printStackTrace();}
	}
}
